import React, { useState } from 'react';
import Dropdown from './GridDropdown';
import axios from 'axios';

const MLdropdown = ({ onModelSelect, trainData, testData }) => {
  const options = [
    { label: 'Logistic Regression', value: 'logistic_regression' },
    { label: 'Naive Bayes', value: 'naive_bayes' },
    { label: 'Random Forest', value: 'random_forest' },
    { label: 'Support Vector Machine', value: 'support_vector_machine' },
    { label: 'Decision Tree', value: 'decision_tree' },
  ];
  const [logisticRegression, setlogisticRegression] = useState(null);
  const [report, setReport] = useState(null);

  const handleOptionSelect = async (selectedValue) => {
    console.log('Selected option:', selectedValue);
    onModelSelect(selectedValue);

    if (selectedValue === 'logistic_regression') {
      axios.post('/logistic_regression')
        .then((response) => {
          console.log(response.data);
          setlogisticRegression(response.data.x);
        })
        .catch((error) => {
          console.error(error);

        });
    }
  };
  const handleGraphUpload = () => {
    const formData = new FormData();
    formData.append('file', trainData);

    axios
      .post('/logistic_regression', formData)
      .then((response) => {
        console.log(response.data);
        if (response.data.success) {
          setReport(response.data.report);


        }
      })
      .catch((error) => {
        console.error(error);

      });
  };

  return (
    <div>
      <h1>ML Model</h1>
      <Dropdown options={options} onSelect={handleOptionSelect} />


          <button onClick={handleGraphUpload}>Upload</button><p>Report : {report} </p>
    </div>
  );
};

export default MLdropdown;
